@刘杨梓 The argument is that cell phone subscriptions are a necessary good roughly one per person. 

Unlike other goods people don't just cancel their subscriptions to save money therefore a contributing factor could be increased death rate and lowered birth rate.

The counter argument is that with high populations the cases of people with two subscriptions have been cancelling their second subscriptions to save money.

